import React from "react";
import './standing_hospital.scss';
import arrowright from '../../../assets/images/arrowright.png'

class Hospital extends React.Component{

    render(){
        return(
            <div className="hospital">
                <div className="hospital-img" style={{ backgroundImage: `url(${this.props.url})`}}></div>
                <h2 className="hospital-name">{this.props.name}</h2>
                <p className="hospital-information">{this.props.information}</p>
                <div className="arrowright"></div>
            </div>
        )
    }

}

export default Hospital
